            moveAlign: async function() {
                try {
                    let depthData = await window.cameraStream.getDepth();
                    let { A, B, C, D, X } = depthData;

                    const points = [A, B, C, D, X];
                    if (points.some(point => typeof point !== 'number' || point <= 0)) {
                        lightController.sendFailureCommand();
                        throw new Error('Некорректные данные глубины');
                    }

                    const maxPoint = Math.max(A, B, C, D, X);
                    const minPoint = Math.min(A, B, C, D, X);
                    if (maxPoint > minPoint * 1.5) {
                        lightController.sendFailureCommand();
                        throw new Error('Слишком большая разница между значениями глубины');
                    }

                    const tolerance = 0.005; 
                    let tolerance_flag= true;
                    const values = [A, B, C, D, X];
                    for (let i = 0; i < values.length; i++) {
                        for (let j = i + 1; j < values.length; j++) {
                            let diff = Math.abs(values[i] - values[j]);
                            let avg = (values[i] + values[j]) / 2;
                            if (diff / avg > tolerance) {
                                tolerance_flag= false;
                                
                            }
                        }
                    }
                    if (tolerance_flag == true){
                        lightController.sendSuccessCommand();
                        return
                    }

                    const avgTop = (A + B) / 2; 
                    const avgBottom = (C + D) / 2; 
                    const avgLeft = (A + C) / 2; 
                    const avgRight = (B + D) / 2; 
            

                    const pitchAdjustment = Math.atan((avgTop - avgBottom) / 6) * (180 / Math.PI); // Наклон по оси X (вдоль поверхности)
                    const rollAdjustment = Math.atan((avgLeft - avgRight) / 9) * (180 / Math.PI); // Наклон по оси Y (перпендикулярно)
            
                    let currentOrientation = window.GlobalUtil.model.robot.state.local.orientation;
            
                    let y_side_c = this.calculateThirdSide(avgLeft,avgRight,rollAdjustment);
                    let x_side_c = this.calculateThirdSide(X,X,pitchAdjustment);

                    const position_correction = {
                        position: {
                            x: x_side_c*10,
                            y: -y_side_c*10,
                            z: 0
                        },
                        orientation: {
                            roll: -rollAdjustment,
                            pitch: -pitchAdjustment,
                            yaw: 0
                        }
                    };
                    await this.MoveToPosition(position_correction, true);
                } catch (error) {
                    
                }
            },
